import React from "react";

export default function Navbar() {
  return (
    <div style={{ backgroundColor: "transparent" }}>
      <nav className="navbar navbar-expand-lg" style={{ backgroundColor: 'transparent' }}>
        <div className="container-fluid" style={{ backgroundColor: 'transparent' }}>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <button className="btn" type="submit" style={{backgroundColor: '#CF4FB1'}}>
              Sign In
            </button>
            <button className="btn mx-2" type="submit" style={{backgroundColor: '#30DBD3'}}>
              Login In
            </button>
          </div>
        </div>
      </nav>
    </div>
  );
}
